window.onload = function () {
  h = $("#bookingWrapper").height()
};

function bookingWrapper() {
  $("#bookingWrapper").animate({
    height: h
  }, 800, function () {
    $("#bookingWrapper #onewayWrapper #panel").css("height", "0");
    $("#overlay").fadeOut("slow", function () {
      $(this).css("top", 80)
    });
    $("#bookingWrapper").css("height", "auto")
  })
}
function panelSlide() {
  $div = $("#bookingWrapper #panel");
  var height = $div.height();
  $div.hide().css({
    height: 0
  });
  if ($("body").hasClass("ibe")) {
    $("#from, #to").unbind("click");
    $("#panel").css({
      display: "block",
      height: "auto"
    })
  } else {
    $("#from, #to").bind("click", function () {
      if ($div.is(":visible")) {} else {
        $("#overlay").fadeIn("fast").css("height", overlayHeight).css("width", overlayWidth);
        if ($(".warningBar").is(":visible")) {
          var top = parseInt($("#overlay").css("top")) + parseInt($(".warningBar").height());
          $("#overlay").css("top", top)
        }
        $div.show().animate({
          height: height
        }, {
          duration: 800,
          complete: function () {
            $("a.closeBtn.expanded").fadeIn("slow");
            $("#previousSearches").fadeIn("slow")
          }
        })
      }
      return false
    })
  }
}
function toggleSearches() {
  $("#previousSearches p.title a").click(function () {
    if (openFlag == 0) {
      $(".previousSearchesList").slideUp("fast", function () {
        $(".topGreyArrow").slideUp("fast")
      });
      $(this).removeClass("close").addClass("open");
      openFlag = 1
    } else {
      $(".topGreyArrow").slideDown("fast", function () {
        $(".previousSearchesList").slideDown("fast")
      });
      $(this).removeClass("open").addClass("close");
      openFlag = 0
    }
    return false
  })
}
function showOffers() {
  $(".JSEnabled .moreOffers li a.showOffers").click(function () {
    if (showflag2 == 0) {
      $("#content").css("z-index", 100);
      $("#overlay").css("height", overlayHeight).css("width", overlayWidth).fadeIn("fast");
      if ($.browser.msie && $.browser.version == 1) {
        $("#offersContainer").animate({
          "margin-top": -696 - (numberOfOffers)
        }, 500)
      } else {
        $("#overlay").css("height", overlayHeight).css("width", overlayWidth).fadeIn("fast");
        $("#overlay").css("z-index", 106);
        $("#content").css("z-index", 107);
        $("#offersContainer").animate({
          "margin-top": -(numberOfOffers)
        }, 500)
      }
      $(".JSEnabled .moreOffers li p.showOffers a.showOffers span").addClass("selected").text("Close more offers");
      showflag2 = 1
    } else {
      if (showflag2 == 1) {
        if ($.browser.msie && $.browser.version == 1) {
          $("#offersContainer").animate({
            "margin-top": -696
          }, 500);
          $("#overlay").fadeOut("slow")
        } else {
          $("#offersContainer").animate({
            "margin-top": 0
          }, 800, function () {
            $("#overlay").fadeOut("slow");
            $("#overlay").css("z-index", 98);
            $("#content").css("z-index", 97)
          })
        }
        $(".JSEnabled .moreOffers li p.showOffers a span").removeClass("selected").text("Show more offers");
        showflag2 = 0
      }
    }
    return false
  })
}
function loadAjaxHtmlSegment(segmentpath, targetDivId) {
  var jContent = $("#" + targetDivId);
  $.ajax({
    url: segmentpath,
    type: "get",
    dataType: "html",
    error: function () {
      multicity.html("<p>Page Not Found!!</p>")
    },
    beforeSend: function () {},
    complete: function () {},
    success: function (strData) {
      jContent.html(strData)
    }
  })
}
function toggleMultiCity2() {
  loadAjaxHtmlSegment("../includes/templates/segments/multicity.html", "multibookingWrapper");
  $("#onewayWrapper").fadeOut("fast", function () {
    $("#multibookingWrapper").fadeIn("slow");
    $("#onewayWrapper .divider, #onewayWrapper #previousSearches, #onewayWrapper #panel").css("display", "none")
  });
  return false
}
function oneWay() {
  if ($("#multibookingWrapper").is(":visible")) {
    $("#multibookingWrapper").fadeOut("fast", function () {
      $("#onewayWrapper, #onewayWrapper .divider, #onewayWrapper #previousSearches, #onewayWrapper #panel").fadeIn("slow");
      $("label[for='returning']").addClass("greyedOut");
      $("#returning").attr("disabled", "disabled");
      $("#oneway").attr("checked", "checked");
      $("#tt_oneway").attr("checked", "checked");
      $(".datePicker").val("")
    })
  }
  return false
}
function returnBack() {
  if ($("#multibookingWrapper").is(":visible")) {
    $("#multibookingWrapper").fadeOut("fast", function () {
      $("#onewayWrapper, #onewayWrapper .divider, #onewayWrapper #previousSearches, #onewayWrapper #panel").fadeIn("slow");
      $("#returnBack").attr("checked", "checked");
      $("label[for='returning']").removeClass("greyedOut");
      $("#returning").removeAttr("disabled");
      $(".datePicker").val("")
    })
  }
  return false
}
function oneWayField() {
  $("label[for='returning']").addClass("greyedOut");
  $("#returning").attr("disabled", "disabled");
  $(".datePicker").val("")
}
function enableField() {
  $("label[for='returning']").removeClass("greyedOut");
  $("#returning").removeAttr("disabled")
}
