function valid(e) {
  var keycode;
  var browserName = navigator.appName;
  if (browserName == "Microsoft Internet Explorer") {
    keycode = e.keyCode;
  } else {
    keycode = e.which;
  }
  if ((keycode > 47 && keycode < 58) || (keycode > 64 && keycode < 91) || (keycode > 96 && keycode < 123) || (keycode == 0) || (keycode == 8) || (keycode == 9)) {
    return true;
  } else if (keycode == 13) {
    document.getElementById("promoCode").onclick();
  } else {
    return false;
  }
}
