function valid(evt) {
  var keycode = (evt.which) ? evt.which : evt.keyCode;

  if ((keycode > 47 && keycode < 58) || (keycode > 64 && keycode < 91) || (keycode > 96 && keycode < 123) || (keycode == 0) || (keycode == 8) || (keycode == 9)) return true;

  else return false;


}

