function selectText(containerid) {
  if (document.selection) {
    var range = document.body.createTextRange();
    range.moveToElementText(document.getElementById(containerid));
    range.select();
  } else if (window.getSelection) {
    var range = document.createRange();
    range.selectNode(document.getElementById(containerid));
    window.getSelection().addRange(range);
  }
}

function geturl() {
  var userEmail = "";
  var strQueryString = "";
  var hasQueryString = document.URL.indexOf('?');
  if (hasQueryString != -1) {
    strQueryString = document.URL.substring(hasQueryString + 1, document.URL.length);
    var firstParam = strQueryString.split('&').shift();
    var paramNmae = firstParam.split("=").shift();
    if (paramNmae == 'referrer') {
      userEmail = "referrer=" + firstParam.split("=").pop();
      return userEmail;
    } else {
      userEmail = "referrer=" + readCookie("mgm");
      return userEmail;
    }

  } else {

    userEmail = "referrer=" + readCookie("mgm");
    return userEmail;
  }
}

